import React from 'react';
import { Link, NavLink } from 'react-router-dom';

const Navbar = () => {
  return (
    <header className="border-b bg-white/70 backdrop-blur" style={{borderBottom: '2px solid #e5e7eb', backgroundColor: 'rgba(255,255,255,0.7)'}}>
      <div className="container mx-auto flex items-center justify-between py-4" style={{maxWidth: '1200px', margin: '0 auto', display: 'flex', alignItems: 'center', justifyContent: 'space-between', padding: '1rem 0'}}>
        <Link to="/" className="text-xl font-semibold" style={{fontSize: '1.25rem', fontWeight: '600', color: '#111827', textDecoration: 'none'}}>ArchShowcase</Link>
        <nav className="flex items-center gap-6">
          <NavLink to="/" className={({ isActive }) => `${isActive ? 'text-black' : 'text-gray-600 hover:text-black'}`} end>
            HOME
          </NavLink>
          <div className="relative group">
            <span className="cursor-default text-gray-600 group-hover:text-black">PROJECTS</span>
            <div className="absolute hidden group-hover:block pt-3 left-0">
              <div className="bg-white border rounded shadow-md py-2 w-56">
                {['RESIDENTIAL', 'COMMERCIAL', 'SCHOOL', 'INTERIOR DESIGN'].map((c) => (
                  <a key={c} href={`/#${c.replace(/\s+/g, '-')}`} className="block px-4 py-2 text-sm hover:bg-gray-50">
                    {c}
                  </a>
                ))}
              </div>
            </div>
          </div>
          <NavLink to="/about" className={() => `text-gray-600 hover:text-black`}>
            ABOUT
          </NavLink>
          <NavLink to="/contact" className={() => `text-gray-600 hover:text-black`}>
            CONTACT
          </NavLink>
        </nav>
      </div>
    </header>
  );
};

export default Navbar;
